import React from 'react';
import Kanban from '../assets/kanban2.jpg'

function Home() {
  return (
    <div className='w-full h-screen bg-[#00000] text-black flex justify-center items-center'>
        
        <div className='max-w-100 h-auto'>
          <h1 className='text-5xl'>"DONT BE BUSY BE PRODUCTIVE"</h1>
          <img src={Kanban}/>
          <h2 className='text-3xl'>HOME</h2>
        </div>
         
    </div>
  )
}

export default Home
